import React from "react";
import { connect } from "react-redux";
import { logout } from "../actions/session";
import Header from '../components/GenericItems/PageHeader'
import MainPolaroids from '../components/MainPolaroids'
import helpers from '../components/Functions/LanguageFunctions'
import PageOverviewTextTitle from '../components/GenericItems/PageOverviewTextTitle'
// import Diet from "../components/Diet";

const mapStateToProps = ({ session }) => ({
  session,
});

const mapDispatchToProps = (dispatch) => ({
  logout: () => dispatch(logout()),
});

const { block } = helpers.newFunction("index");

const Home = ({language}) => (
     <div className="content">
      <Header parentToChild = {language.language[0] === true ? block.titleEnglish : block.titleGerman}/>
      <MainPolaroids/>
      <PageOverviewTextTitle introText = {language.language[0] === true ? block.introTextEnglish : block.introTextGerman}/>
      <PageOverviewTextTitle introText = {language.language[0] === true ? block.introTextEnglish2 : block.introTextGerman2}/>
	  </div>
);
export default connect(mapStateToProps, mapDispatchToProps)(Home);
